svg.script:
// // this is to make javascript work in the SVG, leave it alone

    function updatePitchSVG(instrumentValue){
    // ========================================
    // STUDENT EDIT ZONE
    // This section controls how the gauge displays
    // ========================================

    /**
     * Updates the speed gauge display
     * - The indicator group slides vertically to show speed
     * - -100 = moves UP 1/5 of image height from starting position
     * - 0 = at y=0 (starting position at top of viewBox)
     * - +100 = moves DOWN 1/5 of image height from starting position
     * 
     * Movement is calculated as a fraction of the SVG height so it scales properly
     */

      // Get the SVG's viewBox to calculate height dynamically
      const svg = document.querySelector('svg');
      const viewBox = svg.viewBox.baseVal;
      const svgHeight = 248;//viewBox.height;  //hardcoded to work inside presentation

      // Calculate movement range: 1/5 of the total SVG height
      const movementRange = svgHeight * 0.2; // 0.2 = 1/5

      // Calculate y position offset
      // Positive value moves DOWN (for positive speed), negative value moves UP (for negative speed)
      const yOffset = (instrumentValue / 100) * movementRange;

      // Get the indicator group element
      const indicator = document.getElementById('indicator');
      if (!indicator) {
        console.log('Cannot find element to animate');
        return;
      }

      // Apply vertical translation to move the indicator up or down
      indicator.setAttribute('transform', `translate(0, ${yOffset})`);


    // ========================================
    // END STUDENT EDIT ZONE
    // ========================================

    }


    setInterval(() => { // do this repeatedly

    // Check localStorage for updates
      const thisSVGfilename = 'pitch';//window.location.pathname;
    // this SVG expects a localStorage with the same name as its file
      const localStorageName =  thisSVGfilename.substring(thisSVGfilename.lastIndexOf('/') + 1, thisSVGfilename.lastIndexOf('.'));
      let instrumentValue = localStorage.getItem(localStorageName);



    //if (instrumentValue !== null) {
      // Make sure value is between -100 and +100
   //   instrumentValue = Math.max(-100, Math.min(100, instrumentValue));

  //  } else {
    // no localStorage, so make up a number, so it swings back and forth
    // Initialize static variables if they don't exist
    if (typeof window.pitchtestValue === 'undefined') {
      window.pitchtestValue = -100;
      window.pitchtestDirection = 1; // 1 for increasing, -1 for decreasing
    }

    // Update the test value
    window.pitchtestValue += window.pitchtestDirection * 2; // increment by 2 each time

    // Reverse direction at boundaries
    if (window.pitchtestValue >= 100) {
      window.pitchtestValue = 100;
      window.pitchtestDirection = -1;
    } else if (window.pitchtestValue <= -100) {
      window.pitchtestValue = -100;
      window.pitchtestDirection = 1;
    }

    instrumentValue = window.pitchtestValue;
    //console.log('no local storage "'+localStorageName+'", using test value:', instrumentValue);

    // }

    updatePitchSVG(instrumentValue)



    }, 50);  //end of setInterval code.  50 is 50 milliseconds or 20 times per second.

  //

// this is to make javascript work in the SVG, leave it alone
